import React, { useState, useEffect } from 'react';
import axios from 'axios';

const TrashData = () => {
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    axios.get('https://api-dev-plastico.westeurope.cloudapp.azure.com/v1/geojson/-2.0/43.0/-1.0/44.0?entity_type=trash')
      .then(response => {
        setData(response.data);
        setLoading(false);
      })
      .catch(error => {
        console.error(error);
        setLoading(false);
      });
  }, []);

  return [data, loading];
};

export default TrashData;
